 Luton's first start Week 9 against the Texans, but he's produced a tempered eight receptions for 97 yards in two outings since. Despite the offensive struggles, exemplified by just one total passing TD for the Jaguars between Weeks 10 and 11, Chark remains the clear No. 1 receiving option. The 24-year-old has averaged 8.2 targets per game since Week 4.  Jacksonville will next prepare for a home test against Cleveland on Sunday.\",\"title\":\"Logs four catches against Steelers\"},{\"timeEpochMilli\":\"1606096269000\",\"contents\":\"Jacksonville Jaguars wide receiver D.J. Chark Jr. caught a team-high four passes for a team-high 41 yards in Sunday's loss to the Pittsburgh Steelers. It was a disaster of a game for the Jacksonville passing game, with Chark and his eight targets being the closest thing to a bright spot that there was on a day that featured zero touchdowns and four interceptions. As long as Jake Luton is under center, Chark is a risky WR3 option.\",\"url\":\"https://www.rotoballer.com/player-news/d-j-chark-jr-leads-disappointing-jaguars-passing-day/806948\",\"title\":\"D.J. Chark Jr. Leads Disappointing Jaguars Passing Day\"}],\"nameFirst\":\"D.J.\",\"nameLast\":\"Chark\",\"hasLockedPremiumContent\":true,\"proTeam\":{\"abbreviation\":\"JAC\",\"location\":\"Jacksonville\",\"name\":\"Jaguars\"},\"positionEligibility\":[\"WR\"]},\"requestedGames\":[{\"game\":{\"id\":6307,\"away\":{\"abbreviation\":\"PIT\",\"location\":\"Pittsburgh\",\"name\":\"Steelers\"},\"home\":{\"abbreviation\":\"JAC\",\"location\":\"Jacksonville\",\"name\":\"Jaguars\"},\"startTimeEpochMilli\":\"1606068000000\",\"status\":\"FINAL_SCORE\",\"awayScore\":27,\"homeScore\":3,\"period\":{\"ordinal\":11,\"startEpochMilli\":\"1605610800000\",\"isNow\":true},\"homeResult\":\"LOSE\",\"awayResult\":\"WIN\"},\"stats\":[{\"category\":{\"id\":175,\"abbreviation\":\"Rec\",\"nameSingular\":\"Target % Caught\",\"namePlural\":\"Target % Caught\"},\"value\":{\"value\":50.0,\"formatted\":\"4/8\"}},{\"catego